fields.description:
Öhdəliklər:
Yeni mobil proqram təminatının yazılması;
Tələbləri tam müəyyən edərək təkliflərin verilməsi;
Yeni proqramın keyfiyyət standartlarına cavab verilməsinin  təmin edilməsi;
Mövcud mobil proqramların inkişafı.
Tələblər:
Sahə üzrə 1-2 il iş təcrübəsi;
Səlis Azərbaycan dili, İngilis və Rus dili biliyi arzuolunandır;
Komandada işləmək bacarığı və məsuliyyətlilik;
Analitik düşünmə qabiliyyəti;
Java (Kotlin bilənlərə üstünlük verilir) və ya Swift 5 (Objective-C bilənlərə üstünlük verilir);
Google Android və ya Apple iOS işləmə prinsipini bilməli;
"Mobile Development Life Cycle" üzrə biliklər;
Firebase, Retrofit/GSON, ConstraintLayout, Gradle təcrübəsi;
REST API, GIT ilə işləmə bacarığı;
Cross Platforma yazanlara üstünlük verilir (Flutter və ya React);
Səliqəli və anlaşılan kod yazmaq bacarığı.

İş haqqında məlumat:
Saytların frontend hissələrinin hazırlanması;
Promo-səhifələrin hazırlanması;
İşə fəal və praqmatik yanaşmaq
Yaxşı ünsiyyət bacarıqlar;
Texniki Tələblər:
Webpack, Gulp ilə iş təcrübəsi
VueJS və ya ReactJS ilə iş təcrübəsi
HTML, CSS, SCSS, Javascript-i yüksək səviyyədə bilmək;
Photoshop və Sketch istifadə etmək bacarığı;
Müxtəlif brauzerlərdə işləyə biləcək kod yazmaq.
2 ildən artıq frontend-developer iş təcrübəsi
